import React from "react";

function Footer() {
   return (
      <div>
         <footer position="fixed" bottom='0'>
            <div>
               <p align="center">
                  Copyright &copy; Our Website 2022
               </p>
            </div>
         </footer>
      </div>
   );
}

export default Footer;
